import React from "react";

const Home = () => {
  const loggedInUser = localStorage.getItem("loggedInUser");
  const user = loggedInUser ? JSON.parse(loggedInUser) : null;

  return (
    <div>
      <h1>Welcome {user?.name}</h1>
    </div>
  );
};

export default Home;
